from __future__ import division
import os

os.environ['TF_ENABLE_ONEDNN_OPTS'] = '0'
os.environ['TF_CPP_MIN_LOG_LEVEL'] = '1'
Title = "Flight Training Console"
os.system("title " + Title)
import numpy as np

import tensorflow as tf
from tensorflow import keras
import tkinter as tk
from tkinter import filedialog
import base64
from PIL import Image, ImageTk
import io
import tkinter.font as tkFont



gpus = tf.config.experimental.list_physical_devices('GPU')
if gpus:
    try:
        for gpu in gpus:
            tf.config.experimental.set_memory_growth(gpu, True)
    except RuntimeError as e:
        print(e)





n_steps = 2
batch_size = 32
temperature = 1.0
train_size_fraction = 0.31
default_url = "data:text/plain;charset=utf-8;base64,aGVsbG8hIHRoaXMgaXMgYW4gYWkgdGVzdA=="


tokenizer = None
max_id = None
encoded = None
dataset_size = None
dataset = None
model = None


loading_gif_data_uri = "data:image/gif;base64,"  
favicon_base64 = "data:image/x-icon;base64," 

def show_loading_screen():
    image_data = base64.b64decode(loading_gif_data_uri.split(",")[1])
    gif_image = Image.open(io.BytesIO(image_data))

    loading_root = tk.Toplevel()
    loading_root.configure(bg="black")
    loading_root.attributes("-fullscreen", True)

    gif_label = tk.Label(loading_root, bg="black")
    gif_label.place(relx=0.5, rely=0.5, anchor="center")  

    gif_frames = []
    try:
        while True:
            frame = gif_image.copy()
            gif_frames.append(ImageTk.PhotoImage(frame))
            gif_image.seek(len(gif_frames))
    except EOFError:
        pass

    def animate(index=0):
        gif_label.config(image=gif_frames[index])
        loading_root.after(100, animate, (index + 1) % len(gif_frames))

    animate()
    loading_root.after(4000, loading_root.destroy)

def upload_file():
    file_path = filedialog.askopenfilename(filetypes=[("Text Files", "*.txt")])
    if file_path:
        with open(file_path, "rb") as file:
            file_content = file.read()
            encoded_content = base64.b64encode(file_content).decode('utf-8')
            global default_url
            default_url = f"data:text/plain;charset=utf-8;base64,{encoded_content}"
            load_data()

def load_data():
    global tokenizer, max_id, encoded, dataset_size
    filepath = keras.utils.get_file("default.txt", default_url)
    with open(filepath) as f:
        default_text = f.read()
    
    tokenizer = keras.preprocessing.text.Tokenizer(char_level=True)
    tokenizer.fit_on_texts([default_text])
    max_id = len(tokenizer.word_index)
    [encoded] = np.array(tokenizer.texts_to_sequences([default_text])) - 1
    dataset_size = len(encoded)

    create_model()
    update_params()

def update_params():
    global n_steps, batch_size, temperature, train_size_fraction
    n_steps = int(n_steps_slider.get())
    
    temperature = temperature_slider.get()
    train_size_fraction = train_size_slider.get()

    train_size = int(dataset_size * train_size_fraction)
    global dataset
    dataset = tf.data.Dataset.from_tensor_slices(encoded[:train_size])
    window_length = n_steps + 1
    dataset = dataset.window(window_length, shift=1, drop_remainder=True)
    dataset = dataset.flat_map(lambda window: window.batch(window_length))
    dataset = dataset.shuffle(10000).batch(batch_size)
    dataset = dataset.map(lambda windows: (windows[:, :-1], windows[:, 1:]))
    dataset = dataset.map(lambda X_batch, Y_batch: (tf.one_hot(X_batch, depth=max_id), Y_batch))
    dataset = dataset.repeat().prefetch(1)

    
    steps_per_epoch = max(1, n_steps )
    print(f"Updated Steps per Epoch: {steps_per_epoch}")

def preprocess(texts):
    X = np.array(tokenizer.texts_to_sequences(texts)) - 1
    return tf.one_hot(X, max_id)

def next_char(text):
    X_new = preprocess([text])
    y_proba = model(X_new)[0, -1:, :]
    rescaled_logits = tf.math.log(y_proba) / temperature
    char_id = tf.random.categorical(rescaled_logits, num_samples=1) + 1
    return tokenizer.sequences_to_texts(char_id.numpy())[0]

def create_model():
    global model
    model = keras.models.Sequential([
        keras.layers.Input(shape=(None, max_id)),
        keras.layers.GRU(128, return_sequences=True, dropout=0.2),
        keras.layers.GRU(128, return_sequences=True, dropout=0.2),
        keras.layers.GRU(128, return_sequences=True, dropout=0.2),
        keras.layers.TimeDistributed(keras.layers.Dense(max_id, activation="softmax"))
    ])
    model.compile(loss="sparse_categorical_crossentropy", optimizer="adam")

def complete_text(text, n_chars=50):
    for _ in range(n_chars):
        text += next_char(text)
    return text

def run_model():
    global dataset
    update_params()
    train_size = int(dataset_size * train_size_fraction)

 
    steps_per_epoch = n_steps

    if dataset:
        try:
            model.fit(dataset, epochs=1, steps_per_epoch=steps_per_epoch)
            result = complete_text("t", n_chars=50)
            result_label.config(text="Generated Text: " + result)
        except Exception as e:
            print(f"Error during model fitting: {e}")
    else:
        print("Error: No dataset, please train a model before trying this. Cannot run the model.")

def generate_text():
    try:
        seed_text = root_text_entry.get()
        if not seed_text:
            seed_text = "The "
        result = complete_text(seed_text, n_chars=100)
        result_label.config(text="Generated Text: " + result)
    except Exception as e:
        print(f"Error generating text: {e}")

def set_favicon(window, base64_string):
    try:
        icon_data = base64.b64decode(base64_string.split(",")[1])
        icon_image = Image.open(io.BytesIO(icon_data))
        icon_image = icon_image.resize((16, 16))
        icon_photo = ImageTk.PhotoImage(icon_image)
        window.iconphoto(False, icon_photo)
    except Exception as e:
        print(f"Error setting favicon: {e}")

root = tk.Tk()
root.title("Flight")
root.configure(bg="black")
root.attributes("-fullscreen", True)

set_favicon(root, favicon_base64)

agency_font = tkFont.Font(family="Agency FB", size=12)

def toggle_fullscreen(event=None):
    root.attributes("-fullscreen", not root.attributes("-fullscreen"))

root.bind("<Escape>", toggle_fullscreen)


frame = tk.Frame(root, bg="black")
frame.pack(expand=True)

n_steps_slider = tk.Scale(frame, from_=1, to=1000, orient="horizontal", label="Steps", bg="black", fg="white", font=agency_font)
n_steps_slider.set(n_steps)
n_steps_slider.grid(row=0, column=0, padx=10, pady=10)


temperature_slider = tk.Scale(frame, from_=0.1, to=2.0, resolution=0.1, orient="horizontal", label="Temperature", bg="black", fg="white", font=agency_font)
temperature_slider.set(temperature)
temperature_slider.grid(row=0, column=1, padx=10, pady=10)

train_size_slider = tk.Scale(frame, from_=0.1, to=1.0, resolution=0.01, orient="horizontal", label="Train Size Fraction", bg="black", fg="white", font=agency_font)
train_size_slider.set(train_size_fraction)
train_size_slider.grid(row=1, column=0, padx=10, pady=10)

upload_button = tk.Button(root, text="Upload File", command=upload_file, bg="white", fg="black", font=agency_font)
upload_button.pack(pady=10)

run_button = tk.Button(root, text="Train Model", command=run_model, bg="white", fg="black", font=agency_font)
run_button.pack(pady=10)

root_text_label = tk.Label(root, text="Root Text Input", bg="black", fg="white", font=agency_font)
root_text_label.pack(pady=10)

root_text_entry = tk.Entry(root, bg="white", fg="black", font=agency_font)
root_text_entry.pack(pady=10)

generate_button = tk.Button(root, text="Generate Text", command=generate_text, bg="white", fg="black", font=agency_font)
generate_button.pack(pady=10)

result_label = tk.Label(root, text="Generated Text: ", bg="black", fg="white", font=agency_font)
result_label.pack(pady=10)

show_loading_screen()
root.mainloop()
